import React from 'react';

const HomeListingCard = ({
  imageURL,
  homeName,
  startingPrice,
  beds,
  baths,
  sqft,
  isMultiSection
}) => {
  const
    price = startingPrice.toLocaleString(),
    size = sqft.toLocaleString();
  //if (!homeName) return (null);
  return (
    <React.Fragment>
      <figure>
        <img src={imageURL} />
      </figure>
      <div>
        <h5>{homeName}</h5>
        <p>{beds} beds • {baths} baths • {size} sq. ft.</p>
        <p>Starting in</p>
        <p>${price}</p>
      </div>
    </React.Fragment>
  )
};

export default HomeListingCard;
